package main

import (
	"fmt"
	"time"

	"github.com/davecgh/go-spew/spew"

	"justapengu.in/acsm/pkg/license"
)

const (
	privateKey = ""
)

func main() {
	l, encoded, err := license.GenerateLicense(privateKey, "support@emperorservers.com", time.Time{})

	if err != nil {
		panic(err)
	}

	spew.Dump(l)

	fmt.Println(encoded)
}
